CREATE DEFINER=`root`@`localhost` PROCEDURE `Alumno_search`(IN `criterio_in` VARCHAR(200), IN `tipo_in` VARCHAR(1))
BEGIN

  IF tipo_in = '2' THEN

    SELECT

      cod_persona,

      paterno,

      materno,

      nombres

    FROM alumno

    WHERE CONCAT(PATERNO, ' ', MATERNO, ' ', NOMBRES) LIKE CONCAT(criterio_in, '%')

    ORDER BY paterno;

  ELSEIF tipo_in = '1' THEN

    SELECT

      cod_persona,

      paterno,

      materno,

      nombres

    FROM alumno

    WHERE cod_persona LIKE criterio_in

    ORDER BY paterno;

  END IF;

END ;;
