CREATE DEFINER=`root`@`localhost` PROCEDURE `asistencia_marcar`(IN `cod_asistencia_in` bigint)
BEGIN
if (select estado from asistencia where cod_asistencia=cod_asistencia_in)='F' then
        UPDATE asistencia
        SET estado = 'A',
        hora=time(now())
        WHERE cod_asistencia = cod_asistencia_in;
        else
        UPDATE asistencia
        SET estado = 'F',
        hora=null
		WHERE cod_asistencia = cod_asistencia_in;
        end if;
END ;;
