CREATE DEFINER=`root`@`localhost` PROCEDURE `notas_update`(IN `cod_registro_detalle_in` BIGINT, IN `n1_in` NUMERIC(2), IN `n2_in` NUMERIC(2), IN `n3_in` NUMERIC(2), IN `n4_in` NUMERIC(2), IN `n5_in` NUMERIC(2), IN `ex1_in` NUMERIC(2), IN `n7_in` NUMERIC(2), IN `n8_in` NUMERIC(2), IN `n9_in` NUMERIC(2), IN `n10_in` NUMERIC(2), IN `n11_in` NUMERIC(2), IN `ex2_in` NUMERIC(2))
BEGIN

  IF (n1_in > -1

    AND n1_in < 21)

    AND (n2_in > -1

    AND n2_in < 21)

    AND (n3_in > -1

    AND n3_in < 21)

    AND (n4_in > -1

    AND n4_in < 21)

    AND (n5_in > -1

    AND n5_in < 21)

    AND (ex1_in > -1

    AND ex1_in < 21)

    AND (n7_in > -1

    AND n7_in < 21)

    AND (n8_in > -1

    AND n8_in < 21)

    AND (n9_in > -1

    AND n9_in < 21)

    AND (n10_in > -1

    AND n10_in < 21)

    AND (n11_in > -1

    AND n11_in < 21)

    AND (ex2_in > -1

    AND ex2_in < 21) THEN

    UPDATE notas

    SET n1 = n1_in,

        n2 = n2_in,

        n3 = n3_in,

        n4 = n4_in,

        n5 = n5_in,

        ex1 = ex1_in,

        n7 = n7_in,

        n8 = n8_in,

        n9 = n9_in,

        n10 = n10_in,

        n11 = n11_in,

        ex2 = ex2_in,

        fec_mod = NOW()

    WHERE cod_registro_detalle = cod_registro_detalle_in;

  ELSE

    -- lanzar error

    SIGNAL SQLSTATE '45000'

    SET MESSAGE_TEXT = 'Error de modificacion';

  END IF;

END ;;
