CREATE DEFINER=`root`@`localhost` PROCEDURE `Registro_select`(IN `cod_profesorist_in` CHAR(10))
BEGIN

  SELECT

    r.Cod_registro,

    m.descripcion,

    rf.descripcion,

    h.Descripcion,

    c.Descripcion,

    r.Fecha_inicio,

    r.Fecha_fin,

    r.entregado

  FROM registro r,

       curso c,

       horario h,

       registro_frecuencia rf,

       marca m

  WHERE c.Cod_curso = r.Cod_curso

  AND h.Cod_horario = r.Cod_horario

  AND r.Cod_frecuencia = rf.Cod_Frecuencia

  AND m.cod_marca = r.Cod_marca

  AND r.cod_profesorist = cod_profesorist_in

  ORDER BY r.Fecha_inicio DESC;

END ;;
